"241112":{"id":"241112","name":"Quem Vê Casa...","slug":"quem-ve-casa","original_title":"No Good Deed","overview":"Com a casa à venda, Paul e Lydia precisam encarar segredos de família muito dolorosos; além de conseguir escondê-los de olhares curiosos e compradores implacáveis.","first_air_date":"2024-12-12","episode_run_time":0,"vote_average":6.223,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Liz Feldman"],"production_companies":["Gloria Sanchez Productions"],"genres":["Drama","Comédia"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/4VKhaoO1rhPBVG2iTyFpyipmryG.jpg","poster_path":"https://image.tmdb.org/t/p/original/lRlV0B8SwckG5Nc1aJLiHWSQ1qD.jpg","cast":["Ray Romano","Lisa Kudrow","Linda Cardellini","Abbi Jacobson","Luke Wilson"],"trailer":"F6JmWe8KCPI","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/4DHRgkvn8nY5yWBcFIu0urJr6bU.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/4DHRgkvn8nY5yWBcFIu0urJr6bU.jpg","air_date":"2024-12-12","episode_count":8,"overview":"N/A","vote_average":7.6,"episodes":{"1":{"name":"Casa aberta","overview":"Paul e Lydia discutem sobre o futuro, se defendem de ameaças de chantagem e observam possíveis compradores que visitam sua casa em um bairro nobre de Los Angeles.","air_date":"2024-12-12","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/pDbE4DSF1GJOnu5peAkncwrrk8A.jpg","vote_average":7.5},"2":{"name":"Visita ao imóvel","overview":"As dúvidas de Lydia atrapalham Paul. Ela tem uma conversa emocionante com Sarah. Margo tenta misturar negócios com prazer.","air_date":"2024-12-12","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/atpG01oWGHuVArKKfYW56YPxUI6.jpg","vote_average":7},"3":{"name":"Carta de intenção","overview":"Lydia e Paul discordam sobre como lidar com Mikey. Carla descobre a intensidade da relação de Dennis com a mãe. Leslie e Sarah se deparam com verdades difíceis.","air_date":"2024-12-12","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/hoqrwPZ2lh1gnluoMQJ9OTMJWOV.jpg","vote_average":8},"4":{"name":"Problemas na fundação","overview":"As ações de Lydia forçam Paul a encarar memórias que ele queria esquecer. Margo tenta recuperar a relação com JD. Carla atrapalha os planos de Denise.","air_date":"2024-12-12","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/opRbECzWRY54rSpv3G4PG3P4AyU.jpg","vote_average":7.5},"5":{"name":"Fora do mercado","overview":"A placa de venda cai, provocando especulações. Com Leslie e Sarah à espreita, Margo e JD tentam se aproximar dos Morgans para superar a concorrência.","air_date":"2024-12-12","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/wL8JJe0VrSYqRQOJOKjeSC8Fdgy.jpg","vote_average":8},"6":{"name":"Divulgação total","overview":"Paul ajuda Nate a procurar Mikey. Lydia faz jogo duro. A tentativa de fazer as pazes com Denise é um parto para Carla. Descobertas chocantes abalam dois casamentos.","air_date":"2024-12-12","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/xaPJczhrjqg3GSUofmTzbc7pk0x.jpg","vote_average":8},"7":{"name":"Melhor e última oferta","overview":"Rumores sobre a casa fazem Paul fechar um negócio. Lydia vai a um evento de música. JD fica abalado com as mentiras de Margo. Carla não consegue esconder um segredo.","air_date":"2024-12-12","runtime":35,"still_path":"https://image.tmdb.org/t/p/original/8FlQcLp93LHGfQf7Bc6RVPGLHAp.jpg","vote_average":8},"8":{"name":"Vendida","overview":"Paul e Lydia discutem sobre os próximos passos. Revelações familiares abalam o mundo de Dennis. Um comentário espontâneo leva a uma nova pista e a um possível desfecho.","air_date":"2024-12-12","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/mjPhOATETdGRMDDCeDgzF7uy5LV.jpg","vote_average":7}}}}},
