"245926":{"id":"245926","name":"Ponto de Virada: A Bomba e a Guerra Fria","slug":"ponto-de-virada-a-bomba-e-a-guerra-fria","original_title":"Turning Point: The Bomb and the Cold War","overview":"Com relatos em primeira mão e acesso a figuras proeminentes no mundo todo, esta série documental detalhada analisa a Guerra Fria e suas consequências.","first_air_date":"2024-03-12","episode_run_time":60,"vote_average":7.7,"number_of_seasons":1,"number_of_episodes":9,"created_by":[],"production_companies":["Luminant Media"],"genres":["Documentário"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/6mtckKQpbLughrBxztop4HY5XXM.jpg","poster_path":"https://image.tmdb.org/t/p/original/5XBYN5Sb0yBvvodwr8fJa7iyuo2.jpg","cast":[],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/5XBYN5Sb0yBvvodwr8fJa7iyuo2.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/5XBYN5Sb0yBvvodwr8fJa7iyuo2.jpg","air_date":"2024-03-12","episode_count":9,"overview":"N/A","vote_average":9,"episodes":{"1":{"name":"Nasceu um belo sol","overview":"Durante a Segunda Guerra Mundial, os EUA começam a trabalhar em um projeto secreto, que leva às bombas atômicas no Japão e a um conflito mundial que durou décadas.","air_date":"2024-03-12","runtime":79,"still_path":"https://image.tmdb.org/t/p/original/x5xwHKwDlmy8TUndwCRx6TU1w6m.jpg","vote_average":0},"2":{"name":"Solo envenenado","overview":"O comunismo decola na Rússia e na China. Stalin começa seu governo implacável, e a União Soviética entra em uma era de terror.","air_date":"2024-03-12","runtime":64,"still_path":"https://image.tmdb.org/t/p/original/b9s1u4rIUqwcrK2cj0ti4WEgcVV.jpg","vote_average":0},"3":{"name":"Insanidade institucional","overview":"Na preparação para a guerra contra a União Soviética, os EUA começam a testar armas termonucleares. A CIA é criada e passa a interferir na política global.","air_date":"2024-03-12","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/8dtzoScqpb346qtfrTiQZVM9mIg.jpg","vote_average":0},"4":{"name":"O muro","overview":"Os EUA e a União Soviética começam uma corrida nuclear. Berlim é dividida por um muro. John F. Kennedy busca uma solução pacífica depois de uma crise em Cuba.","air_date":"2024-03-12","runtime":66,"still_path":"https://image.tmdb.org/t/p/original/3eazdRmYDhFrrwp9BVV28plkm3x.jpg","vote_average":0},"5":{"name":"Jogos de guerra","overview":"Os dois lados se preparam para o pior. Ronald Reagan e Mikhail Gorbachev encontram interesses comuns. Um desastre nuclear provoca uma tragédia.","air_date":"2024-03-12","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/vr7y21Y5SVYqiYWhbJiDcIUDrHH.jpg","vote_average":0},"6":{"name":"O império é insustentável","overview":"O domínio da União Soviética sobre o leste europeu enfraquece. Cai o muro de Berlim. O Partido Comunista planeja um golpe contra um líder importante da União Soviética.","air_date":"2024-03-12","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/dbRwKMiL5T5TZSj3UdqGuMMU0vG.jpg","vote_average":10},"7":{"name":"O fim da história","overview":"Surge um novo líder na Rússia, e as repúblicas buscam independência. Com a dissolução da União Soviética, vários países assinam um tratado sobre armas nucleares.","air_date":"2024-03-12","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/mlwzJYEvMhtiFn5tUbFcNeOVOV2.jpg","vote_average":8},"8":{"name":"Moscou não vai ficar quieta","overview":"A Rússia tem dificuldade para encontrar sua identidade nacional com a chegada de Vladimir Putin ao poder. Com o fim da Guerra Fria, começa a guerra contra o terrorismo.","air_date":"2024-03-12","runtime":64,"still_path":"https://image.tmdb.org/t/p/original/wxW106wuHocRthQFwxavRYDI6oS.jpg","vote_average":0},"9":{"name":"Nós não morremos ainda","overview":"A Rússia invade a Geórgia e a Ucrânia, e Putin vira o centro das atenções. Em meio à desinformação, a ameaça de uma guerra nuclear continua.","air_date":"2024-03-12","runtime":72,"still_path":"https://image.tmdb.org/t/p/original/gesRIJ7rT3skFzKKcuOl9pdCaw4.jpg","vote_average":0}}}}},
