"201009":{"id":"201009","name":"Força Policial Indiana","slug":"forca-policial-indiana","original_title":"इंडियन पुलिस फोर्स","overview":"Uma série cheia de ação que acompanha a jornada angustiante do policial de Delhi, Kabir Malik, enquanto ele luta contra um adversário insidioso, Zarar, que escolheu o caminho do terrorismo. Esse drama policial revela uma emocionante perseguição, capturando a busca incansável pela justiça e os sacrifícios feitos no cumprimento do dever.","first_air_date":"2024-01-19","episode_run_time":0,"vote_average":6.7,"number_of_seasons":1,"number_of_episodes":7,"created_by":["Rohit Shetty"],"production_companies":["Reliance Entertainment","Rohit Shetty Productionz"],"genres":["Action & Adventure","Crime"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/KapWiv2ecDdp4nAP0AfWr321T9.jpg","poster_path":"https://image.tmdb.org/t/p/original/7OaWh6EPtl2Z2qpxLKDhkM63Zj2.jpg","cast":["Sidharth Malhotra","Shilpa Shetty Kundra","Vivek Oberoi","Mayank Tandon","Mukesh Rishi"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/7OaWh6EPtl2Z2qpxLKDhkM63Zj2.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/7OaWh6EPtl2Z2qpxLKDhkM63Zj2.jpg","air_date":"2024-01-19","episode_count":7,"overview":"N/A","vote_average":6.2,"episodes":{"1":{"name":"Dia da Fundação da Polícia de Delhi","overview":"No centro da movimentada capital da Índia, Delhi, o caos irrompe quando uma série de explosões mortais abala a cidade. O pânico e o medo tomam conta dos moradores enquanto as explosões parecem intermináveis, deixando um rastro de destruição. A paz da cidade fica abalada e a missão de capturar os responsáveis recai sobre os corajosos homens e mulheres da Polícia de Delhi.","air_date":"2024-01-19","runtime":35,"still_path":"https://image.tmdb.org/t/p/original/9hzvQFES7IKFavvQ4HPO590y6vX.jpg","vote_average":6},"2":{"name":"Uma Ligação Errada","overview":"Ajudados pela chefe do Esquadrão Antiterrorismo de Gujarat, Tara Shetty, Kabir e Vikram analisam as evidências, mas eles continuam frustrados enquanto a investigação só revela becos sem saída. Uma reviravolta inesperada se desenrola e um telefonema feito do esconderijo dos terroristas dá uma pista que pode ajudar a Polícia de Delhi a rastrear sua localização.","air_date":"2024-01-19","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/t4bhPpW17VtwffGahatgp4qWtVN.jpg","vote_average":7},"3":{"name":"A Caçada","overview":"Depois de uma perseguição incansável, Kabir e Vikram finalmente localizam o esconderijo dos terroristas. Em uma emboscada emocionante, a polícia de Delhi confronta os terroristas num violento tiroteio, resultando em vítimas de ambos os lados.","air_date":"2024-01-19","runtime":31,"still_path":"https://image.tmdb.org/t/p/original/7N4BbjPP2kiZFBE22tS7hSxEFXu.jpg","vote_average":0},"4":{"name":"O Fantasma Retorna","overview":"Zarar está mais uma vez em uma missão sinistra de executar atentados na cidade de Jaipur. Ele consegue realizar esses atos mortais. À medida que Kabir fica sabendo das explosões, ele começa a conduzir sua própria investigação ilegal em Jaipur.","air_date":"2024-01-19","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/xzrpeSRkDZ5OoMbGosFUKW9opTk.jpg","vote_average":6},"5":{"name":"A Perda","overview":"Conforme Kabir e a sua equipe conduzem as investigações em Goa, descobrem uma pista. Enquanto isso, Zarar e seu irmão Sikku se preparam para lançar o caos, preparando o cenário para o último ataque. Um trágico acidente se desenrola. Conforme o episódio chega ao fim, a informação da mãe de Nafeesa choca a Polícia e avança a investigação no sentido de descobrir a verdade sobre as intenções de Zarar.","air_date":"2024-01-19","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/e9JcRjzs6qiMyGQgtzHxUrEVKWJ.jpg","vote_average":6},"6":{"name":"A verdade","overview":"Kabir chega a Darbhanga e confronta Nafeesa sobre a verdadeira identidade de Zarar. Chocada com a revelação, Nafeesa desmaia e Kabir a leva ao hospital. Ao perceber a verdade sobre Zarar, Nafeesa se rende à polícia e revela que Zarar estava em Bangladesh. Kabir e Tara Shetty vão até Delhi para obter permissão do Ministro do Interior para uma operação transfronteiriça para trazer Zarar de volta.","air_date":"2024-01-19","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/13IcHNiQTZBf7O6FqTBME5ADJVC.jpg","vote_average":6},"7":{"name":"Chegando em Casa","overview":"Kabir viaja para Bangladesh para encontrar Zarar depois de receber a aprovação do Ministro do Interior. Com a ajuda de Jagtap e Rana, em uma série espetacular de eventos na perseguição de Zarar, Kabir consegue trazer de volta ao seu país o terrorista mais procurado da Índia.","air_date":"2024-01-19","runtime":37,"still_path":"https://image.tmdb.org/t/p/original/lRth1NtQP8pWNgj1EHcndm98waA.jpg","vote_average":7}}}}},
