"220663":{"id":"220663","name":"Caras","slug":"caras","original_title":"Manes","overview":"Billuka é uma renomeada Fintech criada e dirigida em conjunto por Julian e seus amigos: Ricardo, Simón, Santiago, Tomás, Daniel e Mafe. Antonia, filha de um empresário muito importante, chega à Colômbia na esperança de recomeçar. Quando Julian conhece Antonia é amor à primeira vista. Mais tarde, Julian se envolve numa série de conflitos entre amor e negócios.","first_air_date":"2023-02-15","episode_run_time":0,"vote_average":8.4,"number_of_seasons":2,"number_of_episodes":12,"created_by":[],"production_companies":[],"genres":["Drama","Comédia"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/tnf1NFPb3EsyO5eob0K1hquXJmt.jpg","poster_path":"https://image.tmdb.org/t/p/original/j8SPM2M1Ui2dwBBj1gazkHwbOT2.jpg","cast":[],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/dk6bH5y7Q7bNYpQ3u5L4NLS1Roq.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/dk6bH5y7Q7bNYpQ3u5L4NLS1Roq.jpg","air_date":"2023-02-15","episode_count":6,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Assim Somos os Caras","overview":"\"Antonia Miranda\", uma jovem independente recém-chegada de Nova York, está procurando seu caminho no mundo da Fintech, ela assiste à entrevista de emprego em Billuka. Por seu lado, Julián Quintana \"o inconquistável\" é apaixonado quando vê Antonia, sem saber que ela é filha do importante homem de negócios e proprietário de Indústrias Miranda.","air_date":"2023-02-15","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/yRpUqMoNdtNJJCP1yVlyjB0VyV9.jpg","vote_average":0},"2":{"name":"Dilemas Contemporâneos","overview":"O relacionamento de Julian e Antonia começa em meio às discórdias. Miranda visita Billuka e apresenta uma tentadora oferta financeira. Mafe e Marcel se encontram no mesmo bar, e fazem amizade e conversam sobre seus respectivos amigos. Daniel é atraído pelo perfil de uma mulher sedutora e particular. Todos se surpreendem ao ver Antonia chegar a Billuka.","air_date":"2023-02-15","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/3bhEYa9oNQDhHpLfoOStSnsIIWb.jpg","vote_average":0},"3":{"name":"O Sexo e Suas Complicações","overview":"Em Billuka temem que Julian esteja cortejando a Antonia e pondo em risco o negócio de investimentos. Daniel conhece Lorena, uma mulher sexy com um trabalho não convencional que o deixa fascinado. Julian e Antonia têm seu primeiro encontro, mas nem tudo corre conforme o planejado. Miranda é ameaçado com acabar com sua carreira e sua família. Miranda liga para Julián e lhe dá uma advertência.","air_date":"2023-02-15","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/sSxKHoDDSNZgSmloobxVrWwWNkQ.jpg","vote_average":0},"4":{"name":"O Problema do Dinheiro","overview":"Julián dá livre curso a suas emoções e Mafe lhe dá alguns conselhos. Marcel está passando por uma situação sentimental complicada. Antonia recebe a visita de Andrew, que chega para desestabilizar seu presente. Pressionado por sua namorada, Ricardo fica obcecado em parecer mais jovem. Os Caras comemoram o fechamento de um investimento milionário, mas Julián duvida de suas decisões.","air_date":"2023-02-15","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/ffQqDSsbLPLTsDNGMDzKfTJb9Lz.jpg","vote_average":0},"5":{"name":"A Idade e a Imaturidade","overview":"Andrew confessa a Antonia a verdadeira razão pela qual ele rompeu o noivado deles. Um escândalo surge e mancha a imagem de Mario Miranda. Em Billuka estão procurando um investimento alternativo, e por isso sugerem entrar em contato com Lina, ex-parceira de Julián. Através de um aplicativo, Tomás arranja um encontro com uma mulher de mais idade que o deixa apaixonado.","air_date":"2023-02-15","runtime":31,"still_path":"https://image.tmdb.org/t/p/original/kRsOYSzs8eeNVYDvqGefxUIEtJU.jpg","vote_average":0},"6":{"name":"O Compromisso e Seus Sacrifícios","overview":"A imagem ruim de Miranda tem um impacto em seus negócios. Ricardo carrega a culpa de ter sido um mau pai. Antonia toma uma posição importante no negócio familiar. Simón fala a seus amigos que decidiu tornar-se pai em tempo integral. Julián e Antonia dão uma chance reciprocamente. Por outro lado, Santiago permite que novas emoções surjam. Antônia percebe as verdadeiras intenções de Lina.","air_date":"2023-02-15","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/lyMi8LZr64pFSpLCYbexMwRpkh6.jpg","vote_average":0}}},"2":{"name":"Temporada 2","poster_path":"https://image.tmdb.org/t/p/original/gkWnjOb2QvA2b8onBbEKf9o2JKw.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/gkWnjOb2QvA2b8onBbEKf9o2JKw.jpg","air_date":"2024-09-11","episode_count":6,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Honestidade e egoísmo","overview":"\"Julián é recebido com alegria por seus amigos quando traz notícias positivas do Brasil. Seu dilema surge quando ele decide revelar seu segredo a Antônia. Os Caras temem que os brasileiros não sejam honestos com Billuka. Enquanto isso, Daniel é forçado a aceitar a clandestinidade imposta por Mafe. Marcel faz Santiago duvidar de sua masculinidade. Eugênia continua distante de Tomás.\"","air_date":"2024-09-11","runtime":34,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"2":{"name":"Exclusividade e infidelidade","overview":"Julián sente remorso por seu encontro com Lina; os Caras acreditam que foi um erro contar a Antônia. Julian, em seu desespero, tenta obter o perdão de Antônia. Enquanto comemora com seus amigos, Julian recebe a mensagem de Antônia. Daniel sugere a Mafe ir a uma festa de swinger. Santiago explora sua identidade sexual e Tomás descobre a ligação entre Eugênia e Antônia","air_date":"2024-09-11","runtime":30,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"3":{"name":"Vulnerabilidade e atração","overview":"Julián decide impressionar Antônia arranjando ingressos para um show, mas ele precisa ganhar os ingressos em um concurso difícil. Mafe e Marcel unem forças para reunir seus respectivos amigos. Daniel se esforça para participar da troca de casais. Ricardo busca uma segunda chance com Paula. Santiago busca a orientação de Marcel","air_date":"2024-09-11","runtime":34,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"4":{"name":"A sofrência e suas faces","overview":"Daniel, preocupado com o estado de Julian, leva-o para tomar um drinque a fim de animá-lo; Ricardo se une a eles, pois está abatido pela rejeição de Paula. Depois de superar a ressaca, eles recebem boas notícias financeiras e decidem comemorar com um passeio só para Caras. Enquanto isso, Antônia começa a namorar Jacobo. Marcel e Mafe organizam um passeio com Antônia para distraí-la do cineasta","air_date":"2024-09-11","runtime":33,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"5":{"name":"Os medos e as máscaras, Pt. 1","overview":"Os Caras escapam para um luxuoso resort em Rio Alto para esquecerem os problemas sentimentais. Santiago e sua amiga improvisam uma festa; assim, Mafe e Marcel convencem Antônia a ir. Mais tarde na festa, Antônia e Julián se reconectam; porém, a noite complica-se com a chegada inesperada de Jacobo e Lina","air_date":"2024-09-11","runtime":32,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"6":{"name":"Os medos e as máscaras, Pt. 2","overview":"No auge da festa, mal-entendidos amorosos e confissões surpreendentes desencadeiam o caos. Enquanto isso, Tomás tem outro desencontro com Eugenia. No dia seguinte, contra os desejos de Julián, Marcel mostra a Antônia o vídeo de Monserrate, após o que ela sai em busca de Julián","air_date":"2024-09-11","runtime":34,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0}}}}},
